@font-face {
	font-family: 'Montserrat';
	src: url('../fonts/Montserrat-Bold.eot');
	src: local('☺'), url('../fonts/Montserrat-Bold.woff') format('woff'), url('../fonts/Montserrat-Bold.ttf') format('truetype'), url('../fonts/Montserrat-Bold.svg') format('svg');
	font-weight: 700;
	font-style: normal;
}
@font-face {
	font-family: 'Montserrat';
	src: url('../fonts/Montserrat-Regular.eot');
	src: local('☺'), url('../fonts/Montserrat-Regular.woff') format('woff'), url('../fonts/Montserrat-Regular.ttf') format('truetype'), url('../fonts/Montserrat-Regular.svg') format('svg');
	font-weight: 400;
	font-style: normal;
}
* {
    margin: 0;
    padding: 0;
}

html {
    font-size: 14px;
    font-family: 'Montserrat';
    background-color: #f4f4f6;
    color:rgba(31, 32, 65, 1);
}
body {
    font-size: 14px;
}
.site-header {
    width: 1440px;
    height: 70px;
    left: 0px;
    top: 140px;
    display: flex;
    justify-content:space-around;
    padding-left: 14px;
    padding-right: 14px;
    align-items:center;
    align-content:center;
}

.nav {
    display: flex;
    align-items: center;
    list-style: none;
    padding-left: 0;
    &_item {
        margin: 0 15px;
    }
    &_link {
       
        font-weight: 400;
    }
    &_style {
        font-weight: 700;
    }
}

input {     
    list-style: none;    
}


.button_entry {
    border: 2px solid #BC9CFF; /* Параметры рамки */;
    border-radius: 22px;
    width: 87px;
    height: 34px;
    left: 997px;
    top: 158px;
}
 
.button_registration {
    width: 196px;
    height: 34px;
    left: 1104px;
    top: 158px;
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    border-radius: 22px;
    border: 2px solid #BC9CFF;
}

.footer {
    display: flex;
    justify-content: space-around;
    width: 1440px;
    height: 372px;
    top: 360px;
    left: 0px;
    padding-left: 14px;
    padding-right: 14px;
    align-content: center;
    &_text {
        flex-direction:column;
    }
    &_list {
        margin: 20px;
    }
    &_list_text {
        list-style:none; 
        display: flex;
        justify-content:flex-start;
        flex-direction:column;
    }
    &_item_last {
        list-style:none; 
        display: flex;
        justify-content:flex-start;
        flex-direction: column;
    }
    &_item {
        list-style:none;  
    }
    &_list_bold {
        font-weight: 700 ;
        text-decoration:none;
    }
    &_list_normal {
        font-weight: 400;
        text-decoration:none;
    }
}

.down {
    width: 1440px;
    height: 70px;
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    align-content: center;
    justify-content: center;
